INSERT INTO `communities` (`id`, `title`, `content`, `status`, `created_at`, `created_by`, `updated_at`, `updated_by`) VALUES
(1, 'Community Work', '<p><span style=\"font-size:28px\"><strong>&quot;Community service is helping people, but also gaining an understanding about each other and a sense of human compassion.&quot;</strong></span></p>\r\n\r\n<p>In order to realize this aim the L.L.R.M. College of Education has designed and developed a model infusing connection and relationship with the community that develops from community service adds an invaluable layer to education.</p>\r\n\r\n<p><img src=\"data:image/jpeg;base64,\" /></p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4>Our objectives of conducting community work are:</h4>\r\n\r\n<ul>\r\n	<li>To sensitize the trainee teachers towards difficulties faced by the underprivileged sections of our community</li>\r\n	<li>To develop a sense of social responsibility among trainee teachers</li>\r\n	<li>To create awareness of needs and challenges of community and to promote participation, involvement and leadership qualities in carrying out community work.</li>\r\n	<li>To develop essential qualities of responsible future teachers</li>\r\n</ul>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4>Our Students carry out the following community work in the session 2009-2010:</h4>\r\n\r\n<ul>\r\n	<li>Organized blood donation camp.</li>\r\n	<li>Organized awareness camp on traffic rules.</li>\r\n	<li>N.S.S. camp.</li>\r\n	<li>Conducted survey on female foeticide in the village Dhudike</li>\r\n	<li>Organized medical checkup camp for pregnant women.</li>\r\n	<li>Actively participated in polio drops camps.</li>\r\n	<li>Cleanliness camp in slum area.</li>\r\n	<li>Free education to children of slum area by pupil teachers in the evening</li>\r\n	<li>Celebration of Lohri of Girl child and honoring mothers having only one/two daughters</li>\r\n	<li>Survey on Environment Awareness among under privileged class of Dhudike &amp; Slum Area of Ajitwal and Nanaksar.</li>\r\n	<li>Conducted survey on Socio Economic Status and Women Empowerment in Village Dhudike.</li>\r\n</ul>', '1', '2024-04-12 01:42:40', 1, '2024-04-12 05:42:31', 1);

