(1, 'Other Facilities Provided', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna', '<h3>Hostel</h3>\r\n\r\n<p>There are separate hostels for girls and boys. Girls hostel is within the college campus and boys hostel is 1.5 km away from the college campus. Comfortable accommodation is provided in both the hostels. Proper health and hygiene facilities are given to the students in the hostels. Sports and games facilities are also provided to the students. There are spacious rooms with almirahs and adequate furniture. In addition to these mess facility, dinning room,warden&rsquo;s room, common room with T.V., visitors room are also there.</p>\r\n\r\n<p style=\"margin-left:320px\"><img src=\"data:image/jpeg;base64,\" /></p>\r\n\r\n<h4>Transport</h4>\r\n\r\n<p>Though the college is in the rural area, still daily commutation has been made convenient for the staff and students through regular bus service provided by the college from different</p>\r\n\r\n<p style=\"margin-left:320px\"><img src=\"data:image/jpeg;base64,\" /></p>', '1', '2024-04-15 04:24:30', 1, '2024-04-15 04:26:14', 1);

