(1, 'About Us', 'public/about-image/1712656898_about_image.jpg', '<p>Urmila Global is a forward-thinking, dynamic company committed to excellence and innovation across diverse industries. With a strong emphasis on quality and sustainability, Urmila Global has become a trusted name in the global market. The company&rsquo;s diverse portfolio includes cutting-edge solutions and services that cater to a wide range of sectors, ensuring that they meet the ever-evolving demands of clients and customers worldwide.</p>\r\n\r\n<p>Urmila Global&rsquo;s dedication to customer satisfaction, ethical business practices, and continuous improvement has earned it a reputation for reliability and leadership. The company fosters a culture of collaboration, where creative ideas and technical expertise merge to drive growth and achieve success.</p>\r\n\r\n<p style=\"text-align:justify\">Through its global presence and strategic partnerships, Urmila Global is poised for continued growth, innovation, and impact on a global scale. Whether in technology, manufacturing, or other industries, the company remains at the forefront of change, constantly adapting and advancing to meet the needs of the modern world.</p>', '1', '2024-04-09 04:22:50', 1, '2025-01-22 06:29:50', 1);

