(1, 'Liberary details', 'Lala Lajpat Rai Memorial College Of Education, -Dhudike (Moga)\r\nDetails of Library (Session: 2020-21)', '<h3>Liberary</h3>\r\n\r\n<p>The college has a well stocked library with a library hall of seating capacity of 30 students at a time. The library has an open access facility. More than 9000 books are available in the library, and about 14 magazines, in addition to 22 journals on various topics and 9 news papers are regularly subscribed to. In order to enrich the library, every year a number of valuable books on different topics of study are purchased. The library is computerized with internet facility.</p>\r\n\r\n<p style=\"margin-left:160px\"><img src=\"data:image/jpeg;base64,\" /></p>\r\n\r\n<h4>Reading Room</h4>\r\n\r\n<p>The library has a separate reading room with seating capacity of 8 students. The library has a balanced collection of books on different subjects. Library has a good book bank facility for poor and needy students.</p>\r\n\r\n<p style=\"margin-left:160px\"><img src=\"data:image/jpeg;base64,\" /></p>', '1', '2024-04-15 03:04:47', 1, '2024-04-15 03:06:41', 1);

