(1, 'OUR AIM', 'public/about-image/1716796489_about_image.jpg', '<h2 style=\"text-align:center\"><span style=\"font-size:16px\"><strong><span style=\"color:#e74c3c\">TO EQUIP AND PRODUCE DEDICATED TEACHERS WHO ARE INTELLECTUALLY COMPETENT AND CREATIVE SPRITUALLY ORIENTED, MORALLY UPRIGHT, PHYSICALLY HEALTHY, SOCIO-PSYCHOLOGICALLY ADJUSTED.</span></strong></span></h2>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:16px\"><strong><span style=\"color:#e74c3c\">TO SENSITIZE THE TEACHER TRAINEES WITH CAUSE OF NATIONAL IMPORTANCE PARTICULARLY THAT OF RURAL COMMUNITY.</span></strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:16px\"><strong><span style=\"color:#e74c3c\">TO PRODUCE SKILLFULL, LEARNED AND DEDICATED TEACHERS COMMITTED TO THE CAUSE OF NATIONAL DEVELOPMENT AND EDUCATION. 333</span></strong></span></p>', '1', '2024-04-10 01:59:04', 1, '2025-01-22 05:30:45', 1);

