INSERT INTO `workshops` (`id`, `title`, `content`, `status`, `created_at`, `created_by`, `updated_at`, `updated_by`) VALUES
(1, 'Workshops', '<p>College conducts Seminars and Workshops to give the students an opportunity to familiarize themselves with topical issues. The college has organized the following workshops for students, faculty and community: -</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Workshop on Research Methodology:- Workshop on Research Methodology was organized for M.Ed. students for writing research proposals tool construction, data analysis and interpretation of results.</li>\r\n	<li>Workshop on Micro Teaching:- Workshop on Micro Teaching is a regular feature of the college. A one week workshop helps in developing teaching skills in B.Ed. students.</li>\r\n	<li>Workshop on Art and Craft (Soft Toy Making):- To empower the rural women, the college organised a workshop on soft toy making. Rural women actively participated in the workshop along with students from different colleges.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/jpeg;base64,\" /></p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4>Seminar</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The college organized a National level Se4minar on &ldquo;Children with Special Needs &ndash; Thinking Outside The Box&rdquo; on 14th march 2009. For detailed report of National Seminar.<br />\r\n	<a href=\"http://localhost/llrmc/news_university_about_seminar.html\">Click here &raquo;</a></li>\r\n	<li>Seminar on Environment Awareness Among slum dwellers &amp; under privileged on 28th Nov, 2009 by Environment Club in collaboration with S. Sewa Singh Society , Maddoke.</li>\r\n	<li>Seminar by ERA (Educational Research Association) on &ldquo;Quality Concerns in Teaching Practice &amp; Lesson Planning&rdquo; on 27th Feb, 2010. For detailed report of National Seminar.<br />\r\n	<a href=\"http://localhost/llrmc/inaugural-seminar-of-era.html\">Click here &raquo;</a></li>\r\n</ul>', '1', '2024-04-15 04:11:07', 1, '2024-04-15 04:12:28', 1);

